import axios from "axios";

const apikey = process.env.REACT_APP_APIKEY
const baseurl = process.env.REACT_APP_BASEURL

export const getJobList = async() => {
    const job = await axios.get(`${baseurl}?key=31657769-cc724a3f600ddb772dcd00e99&q=yellow+flowers&image_type=photo`)
    return job.data.result
}

export const searchJob = async(q) => {
    const search = await axios.get(`${baseurl}?search=query=${q}&api_key=${apikey}`)
    return search.data
}
